measurements.description:
One hundred three slightly cuppy flowers and seven buds on 39 up to 70-cm inflorescences;
  plant 138 cm wide by 24 cm tall, in round plastic 58-cm pot, grown in bark;
  sepals lanceolate, lavender;
 petals peloric, undulate margins, cream overlaid fuchsia,
 intense fuchsia margins, fushia veins, white splash center;
 lip tri-lobed, midlobe intense fuchsia, side lobes intense fuchsia margins, cream
 veined fuchsia basally, throat yellow; column cream marked fuchsia, anther cap white;
 substance medium; texture matte; four flowers were not peloric.
